INSERT INTO `noticias` (`id_noticia`, `titulo`, `contenido`, `visible`, `fecha_publicacion`, `id_usuario_not`) VALUES
('16102012111012', 'MOZZILA FIREFOX PARA USO DEL SISTEMA', '<p style="text-align: justify;">Mozilla Firefox es un navegador web libre y de c&oacute;digo abierto desarrollado para Microsoft Windows, Mac OS X y GNU/Linux coordinado por la Corporaci&oacute;n Mozilla y la Fundaci&oacute;n Mozilla. Usa el motor Gecko para renderizar p&aacute;ginas webs, el cual implementa actuales y futuros est&aacute;ndares web. A partir de agosto de 2012 Firefox tiene aproximadamente un 23% de la cuota de mercado, convirti&eacute;ndose en el tercer navegador web m&aacute;s usado, con particular &eacute;xito en Indonesia, Alemania y Polonia, donde es el m&aacute;s popular con un 65%, 47% y 47% de uso, respectivamente. <strong><a onclick="window.open('','','');return false;" href="http://www.mozilla.org" target="new">Descargalo aqu&iacute;</a></strong>.</p>', 1, '2012-10-16 11:36:58', 'CIS_ADMIN'),
('16102012111020', 'NAVEGADOR GOOGLE CHROME PARA USO DEL SISTEMA', '<p style="text-align: justify;">Google Chrome es un navegador web desarrollado por Google y compilado con base en componentes de c&oacute;digo abierto como el motor de renderizado WebKit y su estructura de desarrollo de aplicaciones (framework), disponible gratuitamente bajo condiciones de servicio espec&iacute;ficas. Cuenta con m&aacute;s de 310 millones de usuarios, y dependiendo de la fuente de medici&oacute;n global, puede ser considerado el navegador m&aacute;s usado de Internet variando hasta el segundo puesto, algunas veces logrando la popularidad mundial en la primera posici&oacute;n. Su cuota de mercado se sit&uacute;a aproximadamente entre el 17% y 32% para finales de junio de 2012, con particular &eacute;xito en la mayor&iacute;a de pa&iacute;ses de Am&eacute;rica Latina donde es el m&aacute;s popular. El nombre del navegador deriva del t&eacute;rmino usado para el marco de la interfaz gr&aacute;fica de usuario (&laquo;chrome&raquo;).<br /><br />Por su parte, Chromium es el proyecto de software libre con el que se ha desarrollado Google Chrome y es de participaci&oacute;n comunitaria (bajo el &aacute;mbito de Google Code) para fundamentar las bases del dise&ntilde;o y desarrollo del navegador Chrome (junto con la extensi&oacute;n Chrome Frame), adem&aacute;s del sistema operativo Google Chrome OS.10 La porci&oacute;n realizada por Google est&aacute; amparada por la licencia de uso BSD, con otras partes sujetas a una variedad de licencias de c&oacute;digo abierto permisivas que incluyen MIT License, Ms-PL y la triple licencia MPL/GPL/LGPL. En esencia, los aportes hechos por el proyecto libre Chromium fundamentan el c&oacute;digo fuente del navegador base sobre el que est&aacute; construido Chrome y por tanto tendr&aacute; sus mismas caracter&iacute;sticas, pero con un logotipo ligeramente diferente y sin el apoyo comercial o t&eacute;cnico de la compa&ntilde;&iacute;a Google. De acuerdo a la documentaci&oacute;n para desarrolladores, &laquo;&ldquo;Chromium&rdquo; es el nombre del proyecto, no del producto, y no deber&iacute;a aparecer nunca entre las variables del c&oacute;digo, nombres de APIs, etc. Util&iacute;cese &ldquo;chrome&rdquo; en su lugar&raquo;.<br /><br />El 2 de septiembre de 2008 sali&oacute; a la luz la primera versi&oacute;n al mercado, siendo esta una versi&oacute;n beta.12 Finalmente, el 11 de diciembre de 2008 se lanz&oacute; una versi&oacute;n estable al p&uacute;blico en general. Actualmente el navegador est&aacute; disponible para los sistemas operativos de escritorio Microsoft Windows, Mac OS X, Ubuntu, Debian, Fedora, openSUSE, Chrome OS,14 y en los sistemas operativos m&oacute;viles Android15 y iOS.</p>\r\n<p><a href="https://www.google.com/intl/es/chrome/browser/?hl=es" target="new">Descargalo aqu&iacute;</a></p>', 1, '2012-10-16 11:28:32', 'CIS_ADMIN');
