-- base de datos del sistema siregest 
drop database if exists siregest;
 create database siregest default character set utf8 collate utf8_general_ci;
 use siregest;
create table logs (
  id_log double not null auto_increment COMMENT 'CODIGO IDENTIFICADOR DEL LOG',
  ip varchar(20) not null default '' COMMENT 'DIRECCION IP DE LA MAQUINA QUE ACCEDE AL SISTEMA',
  puerto varchar(20) not null default '' COMMENT 'PUERTO USADO POR LA MAQUINA QUE ACCEDE AL SISTEMA',
  fecha datetime not null COMMENT 'FECHA DE ACCESO A LA PAGINA',
  detalles text not null COMMENT 'DETALLE DE LA ACCION EJECUTADA DENTRO DEL SISTEMA',
  url_pagina text COMMENT 'URL DE LA FUNCION A LA QUE SE ESTÁ ACCEDIENDO',
  usuario varchar(60) not null default '' COMMENT 'NOMBRE DE USUARIO QUE ACCEDE AL SISTEMA',
  primary key (id_log)
) AUTO_INCREMENT=1 COMMENT 'ESTA TABLA ALMACENA UN HISTORICO DE ACCESOS Y ACCIONES AL SISTEMA PARA SEGURIDAD DEL MISMO' engine=innodb;

create table tip_ins (
  id_tip_ins int(2) not null AUTO_INCREMENT comment 'CÓDIGO DEL TIPO DE INSTITUCIÓN',
  tip_ins varchar(20) not null default '' COMMENT 'TIPO DE INSTITUCION',
  tip_ins_abr varchar(3) not null default '' COMMENT 'TIPO DE INSTITUCION (ABREVIADO)',
  visible bool not null default true COMMENT 'SI EL ITEM ESTA VISIBLE PARA LOS USUARIOS DEL SISTEMA',
  primary key (id_tip_ins)
) AUTO_INCREMENT=1 COMMENT 'ALMACENA LOS TIPOS DE INSTITUCIONES (PUBLICA,PRIVADA..)' engine=innodb;

create table edo_civil (
  id_edo_civ int(2) not null AUTO_INCREMENT comment 'CÓDIGO DEL ESTADO CIVIL',
  edo_civil varchar(20) not null default '' COMMENT 'ESTADO CIVIL',
  edo_civil_abr varchar(3) not null default '' COMMENT 'ABREVIATURA DEL ESTADO CIVIL',
  visible bool not null default true COMMENT 'SI EL ITEM ESTA VISIBLE PARA LOS USUARIOS DEL SISTEMA',
  primary key (id_edo_civ)
) AUTO_INCREMENT=1 COMMENT 'ALMACENA LOS TIPOS DE ESTADO CIVIL DE LAS PERSONAS REGISTRADAS EN EL SISTEMA' engine=innodb;

create table tip_ocup (
  cod_tip_ocup varchar(6) not null default '' COMMENT 'CODIGO DEL TIPO DE OCUPACION O PROFESION DE LAS PERSONAS REGISTRADAS',
  ocup_profesion varchar(100) not null default '' COMMENT 'DESCRIPCION DE LA OCUPACION O PROFESION (ESTUDIANTE, ABOGADO, INGENIERO)',
  observaciones varchar(250) not null default '' COMMENT 'CUALQUIER INFORMACION DE IMPORTANCIA',
  visible bool not null default true COMMENT 'PERMITE ACTIVAR O DESACTIVAR LA VISIBILIDAD DEL ITEM A LOS USUARIOS DEL SISTEMA (1=VISIBLE,0=NO VISIBLE) o (true=VISIBLE,FALSE=NOVISIBLE)',
  primary key (cod_tip_ocup)
) comment 'ALMACENA LOS TIPOS DE PROFESIONES O OCUPACIONES DE LAS PERSONAS' engine=innodb;



create table tip_doc_per(
  cod_tip_doc_per varchar(6) not null default '' comment 'CODIGO DEL TIPO DE DOCUMENTO PERSONAL',
  tipo_doc varchar(30) not null default '' COMMENT 'TIPO DE DOCUMENTO (No. CEDULA, RIF,CODIGO INTERNO DEL SISTEMA)',
  tipo_doc_abr varchar(6) not null default '' COMMENT 'TIPO DE DOCUMENTO ABREVIADO (NC, RIF,CIS)',
  poner_num bool not null default false COMMENT 'SI SE DEBE USAR EL NUMERO DE IDENTIFICACIÓN', 
  separador varchar(6) not null default '' COMMENT 'SEPARADOR DEL TIPO DE DOCUMENTO ABREVIADO Y EL NUMERO DE IDENTIFICACIÓN',
  num_con_punto bool not null default false COMMENT 'SI SE DEBE COLOCAR PUNTOS EN EL NUM DE IDENTIFICACIÓN EJM: 14.771.188', 
  observaciones varchar(250) not null default '' COMMENT 'CUALQUIER OTRA INFORMACION IMPORTANTE',
  visible bool not null default true COMMENT 'SI EL ITEM ESTA VISIBLE PARA LOS USUARIOS DEL SISTEMA',
  orden tinyint not null default 0 COMMENT 'CAMPO PARA ORDENAR AL MOSTRAR EN LAS PAGINAS',
  primary key (cod_tip_doc_per)
) COMMENT 'ALMACENA LOS TIPOS DE IDENTIFICACION QUE PUEDEN TENER LOS CIUDADANOS Y CIUDADANAS A NIVEL DEL SISTEMA' engine=innodb;

create table parentescos(
  id_parentesco tinyint not null auto_increment,
  parentesco varchar(20) not null default '',
  visible bool not null default true,
  primary key(id_parentesco)
) AUTO_INCREMENT=1 COMMENT 'ALMACENA LOS PARENTESCOS O AFINIDADES FAMILIARES' engine = innodb;

create table tip_telf(
  cod_tip_telf tinyint not null auto_increment COMMENT 'CODIGO DEL TIPO DE TELEFONO' PRIMARY KEY,
  tipo_telefono varchar(15) not null default '' COMMENT 'TIPO DE TELEFONO EJM: MOBIL, FAX, OFICINA, HABITACION ENTRE OTROS',
  visible bool not null default true) AUTO_INCREMENT=1 COMMENT 'ALMACENA LOS TIPOS DE TELEFONOS QUE SE PUEDEN ALMACENAR EN EL SISTEMA' engine=innodb;

create table tip_direcc (
  cod_tip_dir varchar(6) not null default '' COMMENT 'CODIGO DEL TIPO DE DIRECCION',
  tipo_direcc varchar(30) not null default '' COMMENT 'DESCRIPCION DEL TIPO DE DIRECCIONES QUE SE PUEDEN REGISTRAR EN EL SISTEMA (HABITACION,OFICINA ENTRE OTRAS)',
  visible bool not null default true COMMENT 'PERMITE ACTIVAR O DESACTIVAR LA VISIBILIDAD DEL ITEM A LOS USUARIOS DEL SISTEMA (1=VISIBLE,0=NO VISIBLE) o (true=VISIBLE,FALSE=NOVISIBLE)',
  primary key (cod_tip_dir)
) comment 'ALMACENA LOS TIPOS DE DIRECCIONES QUE LAS PERSONAS PUEDEN TENER EJM: HABITACION,OFICINA ENTRE OTROS' engine=innodb;

create table terr_nacionalidad (
  cod_nac varchar(6) not null default '' COMMENT 'CODIGO DE LA NACIONALIDAD',
  nacionalidad varchar(30) not null default '' COMMENT 'DESCRIPCION O NOMBRE DE LA NACIONALIDAD',
  pais varchar(40) not null default '' COMMENT 'DESCRIPCION DEL PAIS AL QUE REFIERE LA NACIONALIDAD',
  visible bool not null default true COMMENT 'PERMITE ACTIVAR O DESACTIVAR LA VISIBILIDAD DEL ITEM A LOS USUARIOS DEL SISTEMA (1=VISIBLE,0=NO VISIBLE) o (true=VISIBLE,FALSE=NOVISIBLE)',
  primary key (cod_nac)
) COMMENT 'ALMACENA LOS DATOS REFERENTE A LAS NACIONALIDADES' engine=innodb;
