  texto_icono varchar(80) not null default '' COMMENT 'NOMBRE DE LA FUNCION (CORTO)',
  icono32 varchar(50) not null default ''  COMMENT 'NOMBRE DEL ICONO DE TAMAÑO 32 PIXELES EJM: ICONO_32.PNG',
  icono48 varchar(50) not null default '' COMMENT 'NOMBRE DEL ICONO DE TAMAÑO DE 48 PIXELES EJM:ICONO_48.PNG',
  descrip_func varchar(250) not null default '' COMMENT 'DESCRIPCION DETALLADA DE LO QUE LA FUNCION REALIZA',
  orden int(11) not null default '0' COMMENT 'ORDEN DE APARICION EN EL MENU DEL SISTEMA',
  url varchar(1000) not null default '' COMMENT 'RUTA DE ACCESO A LA FUNCION PHP EJM: ../carpeta web/nombre_archivo.php',
  activa bool not null default true COMMENT 'SI LA FUNCION ESTA ACTIVA ES DECIR VISIBLE EL VALOR SERIA=1 DE LO CONTRARIO VALOR =0'
) comment 'ALMACENA LAS FUNCIONES DISPONIBLES EN EL SISTEMA' engine=innodb;

create table sis_grupos (
