  visible bool not null default true comment 'SI EL ITEM ESTA VISIBLE PARA LOS USUARIOS DEL SISTEMA',
  primary key (id_grupo)
)  COMMENT 'ALMACENA DATOS REFERENTE A LOS GRUPOS DE USUARIOS DEL SISTEMA' engine=innodb;

create table sis_priv_grup (
  id_privilegio varchar(12) not null default '' COMMENT 'CODIGO IDENTIFICADOR DEL PRIVILEGIO',
  id_func varchar(5) not null default ''  COMMENT 'CODIGO IDENTIFICADOR DE LA FUNCION',
  id_grupo varchar(5) not null default '' COMMENT 'CODIGO IDENTIFICADOR DEL GRUPO DE USUARIO',
  mostrar bool not null default false COMMENT 'PRIVILEGIO MOSTRAR TRUE=VISIBLE, FALSE=NO VISIBLE',
