  imprimir bool not null default false COMMENT 'PRIVILEGIO DE IMPRIMIR',
  exportar bool not null default false COMMENT 'PRIVILEGIO DE EXPORTAR DATOS',
  otro bool not null default false COMMENT 'PRIVILEGIO EXTRA PROGRAMABLE EN EL CODIGO FUENTE DE LA PAGINA',
  primary key (id_privilegio),
  index (id_func), foreign key (id_func) references sis_funciones (id_func) on update cascade on delete cascade,
  index(id_grupo), foreign key (id_grupo) references sis_grupos (id_grupo) on update cascade on delete cascade
)  COMMENT 'ALMACENA LOS PRIVILEGIOS DE GRUPOS DE USUARIOS; DA SEGURIDAD AL SISTEMA EN CUANTO AL ACCESO A LAS FUNCIONES' engine=innodb;

create table datos_per (
