  nombres varchar(35) not null default ''  COMMENT 'NOMBRES DEL CIUDADANO',
  apellidos varchar(35) not null default '' COMMENT 'APELLIDOS DEL CIUDADANO',
  cod_tip_ocup varchar(6) not null default '',
  fecha_nac date not null COMMENT 'FECHA DE NACIMIENTO',
  lugar_nac varchar(150) not null default '' COMMENT 'LUGAR DONDE NACIO EL CIUDADANO O CIUDADANA',
  observaciones longtext not null COMMENT 'CUALQUIER OTRO DATO DE IMPORTANCIA EN EL PERFIL',
  guardado_por varchar(30) not null default '' COMMENT 'FUNCIONARIO QUE EFECTUO O GUARDO LA ACTUACION',
  fecha_g datetime not null COMMENT 'FECHA EN LA QUE SE GUARDO EL REGISTRO',
