) AUTO_INCREMENT=1 COMMENT 'ALMACENA LOS NÚMEROS TELEFONOS DE LAS PERSONAS' engine=innodb;

create table emails_pers(
  id_email double not null auto_increment COMMENT 'CODIGO IDENTIFICADOR DEL EMAIL',
  id_personal varchar(30) not null default '' COMMENT 'CODIGO IDENTIFICADOR DE LA PERSONA EN EL SISTEMA',
  email varchar(60) not null default '' COMMENT 'EMAIL DE LA PERSONA',
  guardado_por varchar(30) not null default '' COMMENT 'FUNCIONARIO QUE EFECTUO O GUARDO LA ACTUACION',
  fecha_g datetime not null COMMENT 'FECHA EN LA QUE SE GUARDO EL REGISTRO',
  PRIMARY KEY(id_email),
  index(id_personal), foreign key(id_personal) references datos_per(id_personal) on update cascade,
  index(guardado_por), foreign key(guardado_por) references datos_per(id_personal) on update cascade on delete cascade
) AUTO_INCREMENT=1 COMMENT 'ALMACENA EMAILS DE LAS PERSONAS' engine=innodb;

create table dis_esc(
  id_dis_esc int(6) not null AUTO_INCREMENT comment 'CÓDIGO DEL DISTRITO ESCOLAR',
  cod_estado_ter int(5) NOT NULL COMMENT 'CODIGO IDENTIFICADOR DEL ESTADO (TERRITORIAL)',
  num_dist int(2) not null default 0 COMMENT 'NÚMERO DEL DISTRITO ESCOLAR',
  dis_esc varchar(60) not null default '' COMMENT 'DENOMINACIÓN DEL DISTRITO ESCOLAR',
  dis_esc_abr varchar(3) not null default '' COMMENT 'DENOMINACIÓN DEL DISTRITO ESCOLAR (ABREVIADO)',
  observaciones varchar(250) not null default '' COMMENT 'CUALQUIER DATO EXTRA NECESARIO',
  visible bool not null default true COMMENT 'SI EL ITEM ESTA VISIBLE PARA LOS USUARIOS DEL SISTEMA',
  guardado_por varchar(30) not null default '' COMMENT 'FUNCIONARIO QUE EFECTUO O GUARDO LA ACTUACION',
  fecha_g datetime not null COMMENT 'FECHA EN LA QUE SE GUARDO EL REGISTRO',
  primary key (id_dis_esc),
  index(guardado_por), foreign key(guardado_por) references datos_per(id_personal) on update cascade
) AUTO_INCREMENT=1 COMMENT 'ALMACENA LOS TIPOS DE DISTRITOS ESCOLARES' engine=innodb;

create table tip_eval_calif(
  id_tip_eval TINYINT not null auto_increment COMMENT 'CODIGO DEL TIPO DE EVALUACION AL INGRESAR LAS CALIFICACIONES',
  tipo_evaluacion varchar(40) not null default '' COMMENT 'TIPO DE EVALUACION (F=FINALES,R=REVISION,P=PENDIENTE)',
  tipo_eval_med varchar(15) not null default '' COMMENT 'TIPO DE EVALUACION (F=FIN.,R=REV.,P=PEN.)',
  tipo_evaluacion_abrev varchar(2) not null default '' COMMENT 'ABREVIATURA DEL TIPO DE EVALUACION',
  observaciones varchar(250) not null default '' COMMENT 'CUALQUIER DATO EXTRA NECESARIO',
  visible bool not null default true COMMENT 'SI EL ITEM ESTA VISIBLE PARA LOS USUARIOS DEL SISTEMA',
  guardado_por varchar(30) not null default '' COMMENT 'FUNCIONARIO QUE EFECTUO O GUARDO LA ACTUACION',
  fecha_g datetime not null COMMENT 'FECHA EN LA QUE SE GUARDO EL REGISTRO',
  primary key(id_tip_eval),
  index(guardado_por), foreign key(guardado_por) references datos_per(id_personal) on update cascade
) AUTO_INCREMENT=1 COMMENT 'ALMACENA LOS TIPOS DE EVALUACION QUE SE PUEDEN SELECCIONAR AL INGRESAR LAS CALIFICACIONES' engine=innodb;


create table usuarios (
  id_usuario varchar(30) not null default '' COMMENT 'CODIGO DE IDENTIFICACION DEL USUARIO=ID_PERSONAL DE LA TABLA datos_per',
  id_grupo_cuenta varchar(5) not null default '' COMMENT 'ID DEL GRUPO AL CUAL PERTENECE EL USUARIO (ADMINISTRADOR,DOCENTE,ESTUDIANTE,SECRETARIO,DIRECTIVO...) DEPENDIENDO DEL GRUPO SE ESTABLECEN LOS PRIVILEGIOS DE ACCESO AL SISTEMA',
  login varchar(15) not null default '' COMMENT 'LOGIN O NOMBRE DE USUARIO PARA ACCEDER AL SISTEMA',
  clave blob not null COMMENT 'CLAVE DE ACCESO AL SISTEMA',
  bloqueado bool not null default false COMMENT 'BLOQUEAR USUARIO. (1=BLOQUEADO,0=NO BLOQUEADO) o (TRUE=BLOQUEADO,FALSE=NO BLOQUEADO)',
  observaciones varchar(250) not null default '' comment 'CUALQUIER INFORMACION DE INTERES GENERAL',
  fecha_g datetime not null COMMENT 'FECHA DE CREACION DEL USUARIO',
  guardado_por varchar(30) not null default '' COMMENT 'USUARIO O PERSONA GUARDO EL REGISTRO',
  primary key (id_usuario),
  index(guardado_por), foreign key(guardado_por) references datos_per(id_personal) on update cascade on delete cascade,
  index(id_usuario), foreign key(id_usuario) references datos_per(id_personal) on update cascade on delete cascade
)  COMMENT 'ALMACENA LOS USUARIOS DEL SISTEMA' engine=innodb;

create table noticias(
  id_noticia varchar(20) primary key not null default '' COMMENT 'CODIGO IDENTIFICADOR DE LA NOTICIA',
  titulo varchar(400) not null default '' COMMENT 'TITULO DE LA NOTICIA',
  contenido longtext not null COMMENT 'CONTENIDO DETALLADO DE LA NOTICIA',
  visible bool not null default true COMMENT 'SI LA NOTICIA ESTA VISIBLE PARA LOS USUARIOS DEL SISTEMA',
  fecha_publicacion datetime not null COMMENT 'FECHA DE PUBLICACION DE LA NOTICIA',
  id_usuario_not varchar(30) not null default '' COMMENT 'CODIGO IDENTIFICADOR DEL USUARIO QUE GUARDO O PUBLICO LA NOTICIA',
  index (id_usuario_not), foreign key (id_usuario_not) references datos_per(id_personal) on update cascade on delete cascade
)  COMMENT 'ALMACENA LAS NOTICIAS QUE APARECEN EN EL FORMULARIO PRINCIPAL DE ACCESO AL SISTEMA' engine=innodb;
  





create table noti_fotos(
  id_foto_noticia int(14) auto_increment not null primary key  COMMENT 'CODIGO IDENTIFICADOR DE LA FOTO-NOTICIA',
  id_noticia varchar(20) not null default '' COMMENT 'CODIGO IDENTIFICADOR DE LA NOTICIA',
  foto_noticia varchar(900) COMMENT 'RUTA DE ACCESO A LA FOTO',
  fecha_g datetime not null COMMENT 'FECHA EN LA QUE SE GUARDO LA FOTO',
  index (id_noticia), foreign key (id_noticia) references noticias(id_noticia) on update cascade on delete cascade
) AUTO_INCREMENT=1 COMMENT 'ALMACENA LAS RUTAS DE LAS FOTOS DE LAS NOTICIAS' engine=innodb;

create table sectores_educ(
  id_sector_educ tinyint(2) not null default 0 COMMENT 'CODIGO IDENTIFICADOR DEL SECTOR EDUCACIONAL',
  sector_educ varchar(30) not null default '' COMMENT 'SECTOR EDUCACIONAL: URBANO,RURAL,INDIGENA,FRONTERAS',
  sector_educ_abrev varchar(3) not null default '' COMMENT 'SECTOR EDUCACIONAL ABREVIADO: URBANO=UR,RURAL=RU,INDIGENA=IN,FRONTERAS=FR',
  observaciones varchar(250) not null default '' COMMENT 'CUALQUIER INFORMACION DE IMPORTANCIA',
  visible bool not null default true comment 'SI EL ITEM ESTA VISIBLE PARA LOS USUARIOS DEL SISTEMA',
  guardado_por varchar(30) not null default '' COMMENT 'FUNCIONARIO QUE EFECTUO O GUARDO LA ACTUACION',
  fecha_g datetime not null COMMENT 'FECHA EN LA QUE SE GUARDO EL REGISTRO',
  primary key(id_sector_educ),
  index(guardado_por), foreign key(guardado_por) references datos_per(id_personal) on update cascade on delete cascade
) COMMENT 'ESTA TABLA ALMACENA LOS SECTORES EDUCATIVOS' engine=innodb;

create table menc_edu(
  cod_mencion_educ varchar(6) not null default '' comment 'CODIGO DE LA MENCION EDUCATIVA',
  mencion varchar(20) not null default '' comment 'MENCION EDUCATIVA QUE LA INSITUCIONES PUEDEN OFRECER (CIENCIAS,HUMANIDADES)',
  mencion_abr varchar(3) not null default '' comment 'MENCION ABREVIADA (CS,HU..)',
  observaciones varchar(250) not null default '' COMMENT 'CUALQUIER INFORMACION DE IMPORTANCIA',
  visible bool not null default true COMMENT 'HABILITA O DESHABILITA LA VISIBILIDAD DE LA MENCION EDUCATIVA: 1,TRUE=VISIBLE Y 0,FALSE=NO VISIBLE',
  guardado_por varchar(30) not null default '' COMMENT 'FUNCIONARIO QUE EFECTUO O GUARDO LA ACTUACION',
  fecha_g datetime not null COMMENT 'FECHA EN LA QUE SE GUARDO EL REGISTRO',
  primary key(cod_mencion_educ),
  index(guardado_por), foreign key(guardado_por) references datos_per(id_personal) on update cascade on delete cascade
) engine = innodb;

create table instituciones(
  cod_plantel varchar(20) not null default '' COMMENT 'CODIGO DEL PLANTEL GENERALMENTE CODIGO DEA',
  den_plantel varchar(400) not null default ''  COMMENT 'NOMBRE O DENOMINACION DEL PLANTEL',
  den_plantel_corta varchar(50) not null default '' COMMENT 'DENOMINACION DEL PLANTEL ABREVIADA',
  id_poblado int(5) NOT NULL COMMENT 'CODIGO DEL POBLADO O CIUDAD A TRAVES DE ESE CODIGO PODEMOS OBTENER EL ESTADO, PARROQUIA, MUNICIPIO,POBLADO O CIUDAD',
  id_dis_esc int(6) NOT NULL COMMENT 'CODIGO IDENTIFICADOR DEL DISTRITO ESCOLAR',
  id_tip_ins int(2) not null comment 'ID DEL TIPO DE INSTITUCIÓN (PU=PÚBLICA), PR=PRIVADA',
  id_sector_educ tinyint(2) not null default 1 COMMENT 'CODIGO IDENTIFICADOR DEL SECTOR EDUCACIONAL (URBANO,RURAL,INDIGENA)',
  email varchar(80) not null default ''  COMMENT 'CORREO ELECTRÓNICO DEL PLANTEL',
  direccion_detalle varchar(250) not null default '' COMMENT 'DETALE DE LA DIRECCION EJM AVENIA, CALLE, EDIFICIO. LOCAL, PISO, APARTAMENTO ENTRE OTROS',
  fecha_creada date not null COMMENT 'FECHA DE CREADA LA INSTITUCION',
  observaciones longtext not null default '' COMMENT 'NOTAS O OBSERVACIONES DE INTERÉS',
  activa bool not null default true,
  guardado_por varchar(30) not null default '' COMMENT 'FUNCIONARIO QUE EFECTUÓ O GUARDÓ LA ACTUACIÓN',
  fecha_g datetime not null COMMENT 'FECHA EN LA QUE SE GUARDO EL REGISTRO',
  primary key (cod_plantel),
  index(id_poblado), foreign key(id_poblado) references terr_poblados(id_poblado) on update cascade,
  index(id_dis_esc), foreign key(id_dis_esc) references dis_esc(id_dis_esc) on update cascade,
  index(id_tip_ins), foreign key(id_tip_ins) references tip_ins(id_tip_ins) on update cascade,
  index(id_sector_educ), foreign key(id_sector_educ) references sectores_educ(id_sector_educ) on update cascade,  
  index(guardado_por), foreign key(guardado_por) references datos_per(id_personal) on update cascade on delete cascade
)COMMENT 'ALMACENA LOS DATOS DE LAS INSTITUCIONES EDUCATIVAS' engine=innodb;

create table inst_telefonos(
  id_telf double not null auto_increment COMMENT 'CODIGO IDENTIFICADOR DEL TELF',
  cod_plantel varchar(20) not null default '' COMMENT 'CODIGO DEL PLANTEL GENERALMENTE CODIGO DEA',
  num_telf varchar(20) not null default '' COMMENT 'TELEFONO DE LA INSTITUCION',
  departamento varchar(30) not null default '' COMMENT 'DESCRIPCION DEL DEPARTAMENTO O PERSONA AL CUAL PERTENECE EL TELEFONO',
  guardado_por varchar(30) not null default '' COMMENT 'FUNCIONARIO QUE EFECTUO O GUARDO LA ACTUACION',
  fecha_g datetime not null COMMENT 'FECHA EN LA QUE SE GUARDO EL REGISTRO',
  PRIMARY KEY(id_telf),
  index(cod_plantel), foreign key(cod_plantel) references instituciones(cod_plantel) on update cascade,
  index(guardado_por), foreign key(guardado_por) references datos_per(id_personal) on update cascade on delete cascade
) AUTO_INCREMENT=1 COMMENT 'ALMACENA LOS TELEFONOS DE LAS INSTITUCIONES' engine=innodb;


create table asig_prog(
  cod_asig_prog varchar(6) not null default '' comment 'CODIGO DE LA ASIGNATURA O DEL PROGRAMA DE EDUC. PARA EL TRABAJO',
  tip_asig varchar(2) not null default '' COMMENT 'TIPO DE LA ASIGNATURA SI ES (ASIGNATURA=AS, PROGRAMA=PR U OTRO=OT)',
  des_mat_prog varchar(50) not null default '' COMMENT 'DESCIPCION O NOMBRE DE LA ASIGNATURA O PROGRAMA',
  mat_prog_med varchar(13) not null default '' COMMENT 'NOMBRE DE LA ASIGNATURA O PROGRAMA ABREVIATURA MEDIANA EJM: CAST LIT.',
  mat_prog_cor varchar(3) not null default '' COMMENT 'ABREVIATURA DEL NOMBRE DE LA ASIGNATURA O PROGRAMA',
  uc int not null default 0 COMMENT 'UNIDADES DE CREDITO',
  orden int not null default 0 COMMENT 'ORDEN DE APARICION EN LOS LISTADOS',
  horas_max_sem tinyint not null default 0 COMMENT 'HORAS MAXIMAS POR SEMANA',
  observaciones varchar(250) not null default '',
  visible bool not null default true COMMENT 'HABILITA O DESHABILITA LA VISIBILIDAD DE LA ASIGNATURA: 1,TRUE=VISIBLE Y 0,FALSE=NO VISIBLE',
  guardado_por varchar(30) not null default '' COMMENT 'FUNCIONARIO QUE EFECTUO O GUARDO LA ACTUACION',
  fecha_g datetime not null COMMENT 'FECHA EN LA QUE SE GUARDO EL REGISTRO',
  primary key(cod_asig_prog),
  index(guardado_por), foreign key(guardado_por) references datos_per(id_personal) on update cascade on delete cascade
) COMMENT 'ALMACENA LAS ASIGNATURAS (MATERIAS) O PROGRAMAS QUE LAS INSTITUCIONES PUEDEN OFRECER A LOS ESTUDIANTES' engine=innodb;
