create table grados_esc(
  cod_grado varchar(6) not null default '' COMMENT 'CODIGO DEL GRADO ESCOLAR',
  grado_letras varchar(20) not null default '' COMMENT 'GRADO ESCOLAR EN LETRAS EJEMPLO: PRIMER AÑO, SEGUNDO AÑO',
  grado_num_letra varchar(10) not null default '' COMMENT 'GRADO ESCOLAR EN NUMERO Y LETRAS EJEMPLO: 1ER AÑO, 2DO AÑO',
  grado_med varchar(3) not null default '' COMMENT 'GRADO ESCOLAR EN LETRAS EJEMPLO: 1er, 2do,7mo,8vo',
  grado_corto varchar(3) not null default '' COMMENT 'GRADO ESCOLAR EN LETRAS EJEMPLO: 1A, 2A,1º,2º',
  orden tinyint(2) not null default 0 COMMENT 'ORDEN DE APARICION DEL GRADO O AÑO EN LOS REPORTES',
  observaciones varchar(250) not null default '' COMMENT 'INFORMACIÓN GENERAL DE INTERÉS',
  visible bool not null default true COMMENT 'HABILITA O DESHABILITA LA VISIBILIDAD DEL GRADO O AÑO: 1,TRUE=VISIBLE Y 0,FALSE=NO VISIBLE',
  guardado_por varchar(30) not null default '' COMMENT 'FUNCIONARIO QUE EFECTUO O GUARDO LA ACTUACION',
  fecha_g datetime not null COMMENT 'FECHA EN LA QUE SE GUARDO EL REGISTRO',
  primary key(cod_grado),
  index(guardado_por), foreign key(guardado_por) references datos_per(id_personal) on update cascade on delete cascade
) engine = innodb;


create table anno_esc_me(
  cod_anno_esc varchar(10) not null default '' COMMENT 'CODIGO DEL AÑO ESCOLAR EJM: 2012-2013',
  descrip_anno_esc varchar(30) not null default '' COMMENT 'DESCRIPCION DEL AÑO ESCOLAR EJM: 2012-2013',
  fecha_inicio date not null COMMENT 'FECHA DE INICIO DEL AÑO ESCOLAR',
  fecha_fin date not null COMMENT 'FECHA DE CULMINACIÓN O TERMINACION DEL AÑO ESCOLAR',
  observaciones varchar(250) not null default '' COMMENT 'CUALQUIER OTRA INFORMACION IMPORTANTE',
  calif_min tinyint(2) not null default 10 COMMENT 'CALIFICACIÓN MINIMA PARA APROBAR CADA MATERIA O ASIGNATURA',
  dias_habiles tinyint(3) not null default 0 COMMENT 'DIAS HABILES SIRVE PARA CALCULAR EL % DE INAISSTENCIA EN BASE A DIAS HABILES',
  porcen_inas_aplazado tinyint(3) not null default 25 COMMENT '% DE INASISENCIAS PARA PERDER EL AÑO ESCOLAR',
  visible bool not null default true COMMENT 'HABILITA O DESHABILITA LA VISIBILIDAD DEL GRADO O AÑO: 1,TRUE=VISIBLE Y 0,FALSE=NO VISIBLE',
  cerrado bool not null default false COMMENT 'HABILITA O DESHABILITA LA EDICIÓN DE NOTAS PARA EL AÑO SELECCIONADO: 1,TRUE=HABILITADO Y 0,FALSE=DESHABILITADO',
  guardado_por varchar(30) not null default '' COMMENT 'FUNCIONARIO QUE EFECTUO O GUARDO LA ACTUACION',
  fecha_g datetime not null COMMENT 'FECHA EN LA QUE SE GUARDO EL REGISTRO',
  primary key(cod_anno_esc),
  index(guardado_por), foreign key(guardado_por) references datos_per(id_personal) on update cascade on delete cascade
) AUTO_INCREMENT=1 COMMENT 'ALMACENA LOS DATOS DEL AÑO ESCOLAR PARA CADA PLANTEL EDUCATIVO' engine = innodb;

create table plan_est_tip(
  id_plan_nivel_est tinyint not null auto_increment COMMENT 'CODIGO IDENTIFICADOR DEL NIVEL EDUCATIVO = PLAN DE ESTUDIO A NIVEL DE SISTEMA',
  cod_plan_nivel_me varchar(6) not null default '' COMMENT 'CODIGO IDENTIFICADOR DEL NIVEL EDUCATIVO = PLAN DE ESTUDIO PROPORCIONADO POR EL MINISTERIO DE EDUCACION PUEDE REPETIRSE: EDUC. MEDIA GENERAL(32011) = TERCERA ETAPA EDUC BASICA(32011) POR LO TANTO SE DIFERENCIA POR EL ID_PLAN_EST A NIVEL DE SISTEMA',
  nivel_plan_est varchar(100) not null default '' COMMENT 'NIVEL EDUCATIVO O PLAN DE ESTUDIO (EDUC. MEDIA GENERAL, TERCERA ETAPA EDUC. BASICA, ETC)',
  notas varchar(250) not null default '' comment 'CUALQUIER OTRA INFORMACION IMPORTANTE',
  visible bool not null default true COMMENT 'HABILITA O DESHABILITA LA VISIBILIDAD DEL NIVEL EDUCATIVO: 1,TRUE=VISIBLE Y 0,FALSE=NO VISIBLE',
  fecha_pub date not null comment 'FECHA DE PUBLICACION EN GACETA O DECRETO',
  guardado_por varchar(30) not null default '' COMMENT 'FUNCIONARIO QUE EFECTUO O GUARDO LA ACTUACION',
  fecha_g datetime not null COMMENT 'FECHA EN LA QUE SE GUARDO EL REGISTRO',  
  primary key(id_plan_nivel_est),
  index(guardado_por), foreign key(guardado_por) references datos_per(id_personal) on update cascade on delete cascade
) AUTO_INCREMENT=1 COMMENT 'ALMACENA LOS PLANES O NIVELES EDUCATIVOS' engine = innodb;

create table plan_est_conf(
  id_plan_nivel_est tinyint not null  COMMENT 'CODIGO IDENTIFICADOR DEL NIVEL EDUCATIVO = PLAN DE ESTUDIO A NIVEL DE SISTEMA',
  cod_grado varchar(6) not null default '' COMMENT 'CODIGO DEL GRADO ESCOLAR (PRIMER AÑO, SEGUNDO AÑO...)',
  cod_mencion_educ varchar(6) not null default '' comment 'CODIGO DE LA MENCION EDUCATIVA (CIENCIAS,HUMANIDADES)',
  id_sector_educ tinyint not null default 0 COMMENT 'CODIGO IDENTIFICADOR DEL SECTOR EDUCACIONAL (URBANO,RURAL)',
  cod_asig_prog varchar(6) not null default '' comment 'CODIGO DE LA ASIGNATURA O DEL PROGRAMA DE EDUCACION PARA EL TRABAJO',
  orden tinyint(2) not null default 0 COMMENT 'ORDEN DE APARICION DE LA MATERIA O ASIGNATURA EN LOS REPORTES',
  hp tinyint(2) not null default 0 comment 'HORAS PRACTICAS',
  ha tinyint(2) not null default 0 COMMENT 'HORAS ACADEMICAS',
  guardado_por varchar(30) not null default '' COMMENT 'FUNCIONARIO QUE EFECTUO O GUARDO LA ACTUACION',
  fecha_g datetime not null COMMENT 'FECHA EN LA QUE SE GUARDO EL REGISTRO',
  primary key(id_plan_nivel_est,cod_grado,cod_mencion_educ,cod_asig_prog,id_sector_educ),
  index(cod_grado), foreign key(cod_grado) references grados_esc(cod_grado) on update cascade,
  index(id_plan_nivel_est), foreign key(id_plan_nivel_est) references plan_est_tip(id_plan_nivel_est) on update cascade on delete cascade,
  index(cod_mencion_educ), foreign key(cod_mencion_educ) references  menc_edu(cod_mencion_educ) on update cascade,
  index(id_sector_educ), foreign key(id_sector_educ) references sectores_educ(id_sector_educ) on update cascade,
  index(cod_asig_prog), foreign key(cod_asig_prog) references asig_prog(cod_asig_prog) on update cascade,
  index(guardado_por), foreign key(guardado_por) references datos_per(id_personal) on update cascade on delete cascade
) COMMENT 'RELACIONA TODOS LOS CAMPOS REFERENTES AL PLAN DE ESTUDIO O NIVEL EDUCATIVO; UN PLANTEL PUEDE TENER VARIAS MENCIONES EDUCATIVAS PARA DIFERENTES SECTORES (RURAL,URBANO...), CADA GRADO (1ER AÑO,2DO AÑO) PUEDE TENER SUS PROPIAS MATERIAS (CATELLANO,MATEMATICA,....)' engine = innodb;





create table inst_secciones(
  id_seccion varchar(40) not null default '' COMMENT 'CODIGO IDENTIFICADOR DE LA SECCION CREADO CON (COD_PLANTEL+ID_PLAN_ESTUDIO+COD_MENCION+COD_SECTOR_EDUCATIVO+COD_GRADO+SECCION_CORTO) PARA EVITAR VALORES REPETIDOS',
  cod_plantel varchar(20) not null default '' COMMENT 'CODIGO DEL PLANTEL GENERALMENTE CODIGO DEA',
  id_plan_nivel_est tinyint not null  COMMENT 'CODIGO IDENTIFICADOR DEL NIVEL EDUCATIVO = PLAN DE ESTUDIO A NIVEL DE SISTEMA',
  cod_mencion_educ varchar(6) not null default '' comment 'CODIGO DE LA MENCION EDUCATIVA (CIENCIAS,HUMANIDADES)',
  id_sector_educ tinyint not null default 0 COMMENT 'CODIGO IDENTIFICADOR DEL SECTOR EDUCACIONAL (URBANO,RURAL)',
  cod_grado varchar(6) not null default '' COMMENT 'CODIGO DEL GRADO ESCOLAR',
  seccion_largo varchar(10) not null default '' COMMENT 'SECCION DETALLE EJEMPLO (SECCION A)',
  seccion_med varchar(8) not null default '' COMMENT 'SECCION MEDIANO EJEMPLO: SECC. A',
  seccion_corto varchar(1) not null default '' COMMENT 'LETRA IDENTIFICADORA DE LA SECCION EJEMPLO: A,B,C (MAX. 2 LETRAS)',
  max_alumn tinyint(4) not null default 0 COMMENT 'MAXIMA CANTIDAD DE ESTUDIANTES QUE SE PUEDEN INSCRIBIR EN LA SECCION',  
  observaciones varchar(250) not null default '' COMMENT 'CUALQUIER INFORMACION DE IMPORTANCIA',
  visible bool not null default true COMMENT 'HABILITA O DESHABILITA LA VISIBILIDAD DE LA SECCION: 1,TRUE=VISIBLE Y 0,FALSE=NO VISIBLE',
  guardado_por varchar(30) not null default '' COMMENT 'FUNCIONARIO QUE EFECTUO O GUARDO LA ACTUACION',
  fecha_g datetime not null COMMENT 'FECHA EN LA QUE SE GUARDO EL REGISTRO',
  primary key(id_seccion),
  index(cod_plantel), foreign key(cod_plantel) references instituciones(cod_plantel) on update cascade,
  index(id_plan_nivel_est), foreign key(id_plan_nivel_est) references plan_est_tip(id_plan_nivel_est) on update cascade on delete cascade,
  index(cod_mencion_educ), foreign key(cod_mencion_educ) references  menc_edu(cod_mencion_educ) on update cascade,
  index(id_sector_educ), foreign key(id_sector_educ) references sectores_educ(id_sector_educ) on update cascade,
  index(cod_grado), foreign key(cod_grado) references grados_esc(cod_grado) on update cascade,
  index(guardado_por), foreign key(guardado_por) references datos_per(id_personal) on update cascade on delete cascade
) engine = innodb;


create table escolaridad(
  id_escolaridad varchar(6) not null default '' COMMENT 'CODIGO DE ESCOLARIDAD',
  escolaridad varchar(35) not null default '' COMMENT 'DESCRIPCION DE LA ESCOLARIDAD (REGULAR,REPITIENTE,REGULAR CON MATERIA PENDIENTE,EQUIVALENCIA',
  escolaridad_abrev varchar(3) not null default '' COMMENT 'ABREVIATURA DE LA ESCOLARIDAD', 
  observaciones varchar(250) not null default '' COMMENT 'CUALQUIER INFORMACION DE IMPORTANCIA',
  visible bool not null default true,
  primary key(id_escolaridad)
) COMMENT 'ALMACENA LA ESCOLARIDAD QUE PUEDE CURSAR LOS ESTUDIANTES' engine = innodb;



create table tip_recaudos(
  id_tip_recaudo int not null auto_increment COMMENT 'CODIGO DEL TIPO DE RECAUDOS QUE SE PUEDEN CONSIGNAR',
  cod_grado varchar(6) not null default '' COMMENT 'CODIGO DEL GRADO ESCOLAR (SE PUEDEN CONSIGNAR DIFERENTES RECAUDOS DEPENDE DEL GRADO A CURSAR',
  descrip_recaudo varchar(100) not null default '' COMMENT 'DESCRIPCION O NOMBRE DEL RECAUDO QUE SE DEBE CONSIGNAR',
  observaciones varchar(250) not null default '' COMMENT 'CUALQUIER INFORMACION DE IMPORTANCIA',
  visible bool not null default true COMMENT 'HABILITA O DESHABILITA LA VISIBILIDAD RECAUDO: 1,TRUE=VISIBLE Y 0,FALSE=NO VISIBLE',
  todos bool not null default true COMMENT 'SI EL RECAUDO ES PARA TODOS LOS GRADOS: 1,TRUE=VISIBLE Y 0,FALSE=NO VISIBLE',
  guardado_por varchar(30) not null default '' COMMENT 'FUNCIONARIO QUE EFECTUO O GUARDO LA ACTUACION',
  fecha_g datetime not null COMMENT 'FECHA EN LA QUE SE GUARDO EL REGISTRO',
  primary key(id_tip_recaudo),
  index(cod_grado), foreign key(cod_grado) references grados_esc(cod_grado) on update cascade,
  index(guardado_por), foreign key(guardado_por) references datos_per(id_personal) on update cascade on delete cascade
) AUTO_INCREMENT=1 COMMENT 'ALMACENA LOS TIPOS DE RECAUDOS QUE SE PUEDEN CONSIGNAR AL MOMENTO DE INSCRIBIR A LOS ESTUDIANTES CADA PLAN DE ESTUDIO TIENE DIFERENTES RECAUDOS DEPENDIENDO DEL GRADO A INSCRIBIR' engine=innodb;

create table usuario_plantel(
  id_personal varchar(30) not null default '' COMMENT 'CODIGO DE IDENTIFICACION PERSONAL NORMALMENTE COMPUESTO DEL CODIGO DEL COD_TIP_DOC_PER+NUM_IDENTIFICACION',
  cod_plantel varchar(20) not null default '' COMMENT 'CODIGO DEL PLANTEL GENERALMENTE CODIGO DEA',
  fecha_asig date not null COMMENT 'FECHA DE ASIGNACIÓN',  
  guardado_por varchar(30) not null default '' COMMENT 'FUNCIONARIO QUE EFECTUO O GUARDO LA ACTUACION',
  fecha_g datetime not null COMMENT 'FECHA EN LA QUE SE GUARDO EL REGISTRO',
  primary key(id_personal,cod_plantel),
  index(id_personal), foreign key(id_personal) references datos_per(id_personal) on update cascade,
  index(cod_plantel), foreign key(cod_plantel) references instituciones(cod_plantel) on update cascade,
  index(guardado_por), foreign key(guardado_por) references datos_per(id_personal) on update cascade
) comment 'ALMACENA LA ASIGNACIÓN DE LOS DOCENTES A PLANTEL EDUCATIVO PARA FILTRAR EN LISTAS DE SELECCIÓN (COMBOS)' engine=innodb;

create table asi_doc_sec(
  cod_anno_esc varchar(10) not null default '' COMMENT 'CODIGO DEL AÑO ESCOLAR EJM: 2012-2013',
  id_seccion varchar(40) not null default '' COMMENT 'CODIGO IDENTIFICADOR DE LA SECCION',  
  cod_asig_prog varchar(6) not null default '' comment 'CODIGO DE LA ASIGNATURA O DEL PROGRAMA DE EDUC. PARA EL TRABAJO',
  id_profesor varchar(30) not null default '' COMMENT 'CODIGO DEL PROFESOR',
  observaciones varchar(250) not null default '' COMMENT 'CUALQUIER INFORMACION DE IMPORTANCIA',
  id_docente_guia varchar(30) not null default '' COMMENT 'DOCENTE GUIA DE LA SECCION',
  guardado_por varchar(30) not null default '' COMMENT 'FUNCIONARIO QUE EFECTUO O GUARDO LA ACTUACION',
  fecha_g datetime not null COMMENT 'FECHA EN LA QUE SE GUARDO EL REGISTRO',
  primary key(cod_anno_esc,id_seccion,cod_asig_prog),
  index(cod_anno_esc), foreign key(cod_anno_esc) references anno_esc_me(cod_anno_esc) on update cascade,
  index(id_seccion), foreign key(id_seccion) references inst_secciones(id_seccion) on update cascade,
  index(cod_asig_prog), foreign key(cod_asig_prog) references asig_prog(cod_asig_prog) on update cascade,
  index(id_profesor), foreign key(id_profesor) references datos_per(id_personal) on update cascade on delete cascade,
  index(id_docente_guia), foreign key(id_docente_guia) references datos_per(id_personal) on update cascade on delete cascade,
  index(guardado_por), foreign key(guardado_por) references datos_per(id_personal) on update cascade on delete cascade
) COMMENT 'GUARDA ASIGNACIONS DE SECCIONES A DOCENTES Y SUS RESPECTIVAS ASIGNATURAS O MATERIAS Y PROGRAMAS PARA CADA AÑO ESCOLAR' engine = innodb;

create table alum_insc_recaud(
  id_personal varchar(30) not null default '' COMMENT 'CODIGO DE IDENTIFICACION PERSONAL NORMALMENTE COMPUESTO DEL CODIGO DEL COD_TIP_DOC_PER+NUM_IDENTIFICACION',
  cod_anno_esc varchar(10) not null default '' COMMENT 'CODIGO DEL AÑO ESCOLAR',
  cod_grado varchar(6) not null default '' COMMENT 'CODIGO DEL GRADO ESCOLAR',
  id_tip_recaudo int not null default 0 COMMENT 'CODIGO IDENTIFICADOR DEL TIPO DE RECAUDO A CONSIGNAR',
  guardado_por varchar(30) not null default '' COMMENT 'FUNCIONARIO QUE EFECTUO O GUARDO LA ACTUACION',
  fecha_g datetime not null COMMENT 'FECHA EN LA QUE SE GUARDO EL REGISTRO',
  observaciones varchar(200) not null default '' COMMENT 'CUALQUIER INFORMACION DE IMPORTANCIA',
  primary key(id_personal,cod_anno_esc,id_tip_recaudo),
  index(id_personal),foreign key(id_personal) references datos_per(id_personal) on update cascade on delete cascade,
  index(guardado_por),foreign key(guardado_por) references datos_per(id_personal) on update cascade on delete cascade,
  index(cod_anno_esc),foreign key(cod_anno_esc) references anno_esc_me(cod_anno_esc) on update cascade,
  index(cod_grado), foreign key(cod_grado) references grados_esc(cod_grado) on update cascade,
  index(id_tip_recaudo),foreign key(id_tip_recaudo) references tip_recaudos(id_tip_recaudo) on update cascade
) COMMENT 'ALMACENA UNA RELACION DE SI SE HAN CONSIGNADO LOS RECAUDOS SOLICITADOS AL MOMENTO DE INSCRIBIR AL ESTUDIANTE' engine = innodb;

create table alum_repr(
  id_alumno varchar(30) not null default '' COMMENT 'CODIGO DE IDENTIFICACION PERSONAL NORMALMENTE COMPUESTO DEL CODIGO DEL COD_TIP_DOC_PER+NUM_IDENTIFICACION',
  id_representante varchar(30) not null default '' COMMENT 'CODIGO DE IDENTIFICACION PERSONAL NORMALMENTE COMPUESTO DEL CODIGO DEL COD_TIP_DOC_PER+NUM_IDENTIFICACION',
  id_parentesco tinyint not null default 0 COMMENT 'CODIGO IDENTIFICADOR DEL PARENTESCO (MADRE,PADRE Y OTROS)',
  representante bool not null default false COMMENT '1= REPRESENTANTE DEL ESTUDIANTE EN LA INSTITUCIÓN, 0=FAMILIAR',
  guardado_por varchar(30) not null default '' COMMENT 'FUNCIONARIO QUE EFECTUO O GUARDO LA ACTUACION',
  fecha_g datetime not null COMMENT 'FECHA EN LA QUE SE GUARDO EL REGISTRO',
  observaciones varchar(500) not null default '',
  primary key(id_alumno,id_representante),
  index(id_alumno),foreign key(id_alumno) references datos_per(id_personal) on update cascade on delete cascade,
  index(id_representante),foreign key(id_representante) references datos_per(id_personal) on update cascade on delete cascade,
  index(guardado_por),foreign key(guardado_por) references datos_per(id_personal) on update cascade on delete cascade,
  index(id_parentesco), foreign key(id_parentesco) references parentescos(id_parentesco) on update cascade  on delete cascade
) COMMENT 'ALMACENA LOS REPRESENTANTES Y SU RELACION CON EL ESTUDIANTE ASI COMO TAMBIEN EL PARENTESCO' engine = innodb;

create table alum_insc_notas(
  id_personal varchar(30) not null default '' COMMENT 'CODIGO DE IDENTIFICACION DEL ESTUDIANTE NORMALMENTE COMPUESTO DEL CODIGO DEL COD_TIP_DOC_PER+NUM_IDENTIFICACION',
  cod_anno_esc varchar(10) not null default '' COMMENT 'CODIGO IDENTIFICADOR DEL AÑO ESCOLAR',
  cod_plantel_proc varchar(30) not null default '' COMMENT 'CODIGO DEL PLANTEL DE PROCEDENCIA GENERALMENTE CODIGO DEA',
  cod_grado varchar(6) not null default '' COMMENT 'CODIGO DEL GRADO ESCOLAR',
  id_seccion varchar(40) not null default '' COMMENT 'CODIGO DE LA SECCION DONDE EL ESTUDIANTE SE INSCRIBIRA',
  cod_asig_prog varchar(6) not null default '' comment 'CODIGO DE LA ASIGNATURA O DEL PROGRAMA DE EDUC. PARA EL TRABAJO',
  mat_pend bool not null default false COMMENT 'CAMPO PARA VERIFICAR SI LA ASIGNATURA ES O NO PENDIENTE DEL GRADO O AÑO ANTERIOR',
  id_tip_eval tinyint not null  default 1 COMMENT 'CODIGO DEL TIPO DE EVALUACION AL INGRESAR LAS CALIFICACIONES SI FUE: (1=FINALES,2=REVISION,3=MATERIA_PENDIENTE)',
  fecha_eval date not null COMMENT 'FECHA DE EVALUACION USADA PARA EL RESUMEN FINAL',  
  id_escolaridad varchar(6) not null default '' COMMENT 'CODIGO DE ESCOLARIDAD (REGULAR, REPITIENTE ...)',
  i1 TINYINT(2) not null default 0 comment 'TOTAL DE INASISTENCIAS DLE ESTUDIANTE EN EL LAPSO 1',
  i2 TINYINT(2) not null default 0 comment 'TOTAL DE INASISTENCIAS DLE ESTUDIANTE EN EL LAPSO 2',
  i3 TINYINT(2) not null default 0 comment 'TOTAL DE INASISTENCIAS DLE ESTUDIANTE EN EL LAPSO 3',
  n1 TINYINT(2) not null default 0 comment 'CALIFICACION DEL ESTUDIANTE CUANTITATIVA DESDE 01 HASTA 20',
  n2 TINYINT(2) not null default 0 comment 'CALIFICACION DEL ESTUDIANTE CUANTITATIVA DESDE 01 HASTA 20',
  n3 TINYINT(2) not null default 0 comment 'CALIFICACION DEL ESTUDIANTE CUANTITATIVA DESDE 01 HASTA 20',
  rev TINYINT(2) not null default 0 comment 'CALIFICACION DEL ESTUDIANTE EN REVISION CUANTITATIVA DESDE 01 HASTA 20',
  observaciones varchar(500) not null default '' COMMENT 'CUALQUIER INFORMACION DE IMPORTANCIA O EVALUACIÓN CUALITATIVA',
  fecha_inscrip datetime not null COMMENT 'FECHA DE INSCRIPCION',  
  inscrito_por varchar(30) not null default '' COMMENT 'FUNCIONARIO QUE INSCRIBIÓ EL ESTUDIANTE',
  guardado_por varchar(30) not null default '' COMMENT 'FUNCIONARIO QUE HIZO LA ULTIMA MODIFICACIÓN DE LAS NOTAS',
  fecha_g datetime not null COMMENT 'FECHA EN LA QUE SE GUARDO EL REGISTRO',
  primary key(id_personal,cod_anno_esc,cod_asig_prog,id_seccion),
  index(id_personal), foreign key(id_personal) references datos_per(id_personal) on update cascade, 
  index(cod_anno_esc), foreign key(cod_anno_esc) references anno_esc_me(cod_anno_esc) on update cascade,
  index(cod_plantel_proc), foreign key(cod_plantel_proc) references instituciones(cod_plantel) on update cascade,
  index(cod_grado), foreign key(cod_grado) references grados_esc(cod_grado) on update cascade,
  index(id_seccion), foreign key(id_seccion) references inst_secciones(id_seccion) on update cascade,
  index(cod_asig_prog), foreign key(cod_asig_prog) references asig_prog(cod_asig_prog) on update cascade,
  index(id_tip_eval), foreign key(id_tip_eval) references tip_eval_calif(id_tip_eval) on update cascade,
  index(id_escolaridad), foreign key(id_escolaridad) references escolaridad(id_escolaridad) on update cascade,
  index(inscrito_por), foreign key(inscrito_por) references datos_per(id_personal) on update cascade,
  index(guardado_por), foreign key(guardado_por) references datos_per(id_personal) on update cascade
) engine = innodb;

create table alumn_retiros(
  id_personal varchar(30) not null default '' COMMENT 'CODIGO DE IDENTIFICACION DEL ESTUDIANTE NORMALMENTE COMPUESTO DEL CODIGO DEL COD_TIP_DOC_PER+NUM_IDENTIFICACION',
  cod_anno_esc varchar(10) not null default '' COMMENT 'CODIGO IDENTIFICADOR DEL AÑO ESCOLAR',
  cod_plantel varchar(30) not null default '' COMMENT 'CODIGO DEL PLANTEL GENERALMENTE CODIGO DEA',
  id_seccion varchar(40) not null default '' COMMENT 'CODIGO DE LA SECCION DONDE EL ESTUDIANTE SE CURSA LAS ASIGNATURAS',
  fecha_ret date not null COMMENT 'FECHA EN LA QUE EL ALUMNO SE RETIRÓ',
  motivo_retiro longtext not null default '' COMMENT 'MOTIVO DEL RETIRO DEL ALUMNO',
  observaciones longtext not null default '' COMMENT 'NOTAS DE INTERÉS SOBRE EL RETIRO DEL ALUMNO',
  guardado_por varchar(30) not null default '' COMMENT 'FUNCIONARIO QUE HIZO LA ULTIMA MODIFICACIÓN DE LAS NOTAS',
  fecha_g datetime not null COMMENT 'FECHA EN LA QUE SE GUARDO EL REGISTRO',
  primary key (id_personal,cod_anno_esc,id_seccion),
  index(id_personal), foreign key(id_personal) references datos_per(id_personal) on update cascade,
  index(cod_anno_esc), foreign key(cod_anno_esc) references anno_esc_me(cod_anno_esc) on update cascade, 
  index(cod_plantel), foreign key(cod_plantel) references instituciones(cod_plantel) on update cascade,
  index(guardado_por), foreign key(guardado_por) references datos_per(id_personal) on update cascade
)engine=innodb comment 'CONTIENE UN REGISTRO DE LOS ALUMNOS QUE SE HAN RETIRADO DE LA INSTITUCIÓN PARA EFECTOS ESTADÍSTICOS';

create table agenda_pers(
  id_apunte double not null auto_increment COMMENT 'CODIGO DEL APUNTE',
  id_personal varchar(30) not null default '' COMMENT 'CODIGO DE IDENTIFICACION DEL ESTUDIANTE NORMALMENTE COMPUESTO DEL CODIGO DEL COD_TIP_DOC_PER+NUM_IDENTIFICACION',
  fecha_act datetime not null COMMENT 'FECHA DE LA ACTIVIDAD',
  descripcion longtext not null default '' COMMENT 'DESCRIPCION DE LA ACTIVIDAD A REALIZAR',
  cerrada bool not null default false comment 'SI LA ACTIVIDAD ESTÁ TERMINADA',
  primary key(id_apunte),
  index(id_personal), foreign key(id_personal) references datos_per(id_personal) on update cascade
) engine=innodb comment 'CONTIENE PLANIFICACIÓN DE AGENDA DE TRABAJO DE LOS USUARIOS';

